import React from 'react';
import './../css/App.css';

export function Lister() {

    const numbers = [1, 2, 3, 4, 5];
    const listItems = numbers.map((number) =>
        <li>{number}</li>
    );

    return <ul>{listItems}</ul>;
}

export default Lister;
